import React from 'react';
import { useIntl } from 'react-intl';
import {
  Tabs,
  TabList,
  TabPanels,
  Tab,
  TabPanel,
  Box,
  Center,
  Button,
} from '@chakra-ui/react';
import Layout from '../Layout';
import messages from './messages';
import '../../assets/customStyle.css';
import './style.css';
import BranchList from '../BranchList';
import { useHistory } from 'react-router';
import { UseOnboardContext } from '../../App';

const BranchDashboard = () => {
  const intl = useIntl();
  const history = useHistory();
  const { onboard } = UseOnboardContext();

  if (onboard && onboard < 2) {
    return (
      <Center minHeight='80vh' flexDirection='column'>
        <Box mb={4} textStyle='medium' display='block'>
          Please complete distributor onboarding
        </Box>
        <Button onClick={() => history.push('/distributor')} variant='normal'>
          {' '}
          Go to distributor
        </Button>
      </Center>
    );
  }
  return (
    <>
      <div className='w-full'>
        <BranchList />
      </div>
    </>
  );
};

export default BranchDashboard;
